    false,nt"url": null,nt"notes": "The Illinois Liquor Control Act of 1934
    permits voters in any precinct in the City of Chicago to vote an entire precinct
    u201cdryu201d through a local option referendum. If a precinct has been voted u201cdry,u201d
    no liquor licenses can be issued. rnrnVOTE_DRY_I column is the Precinct/Ward which
    was voted dry.  It reflects the Ward/Precinct that was effective at the date of
    the referendum.  Ward/Precinct boundaries may have changed since that date.  STATUS
    column indicates if the precinct was voted 'dry' or 'wet'. The Illinois Liquor Control
    Act of 1934 permits voters in any precinct in the City of Chicago to vote an entire
    precinct u201cdryu201d through a local option referendum. rn rnIf a precinct has
    been voted u201cDry/Dry,u201d  no liquor licenses, other than a catereru2019s liquor
